import { useNavigate } from 'react-router-dom';
import { MdRestaurant, MdLocalGasStation, MdBuild, MdHealthAndSafety, MdScience, MdPool, MdLocalShipping } from 'react-icons/md';

{/*const inspections = [
  { title: 'Canteen Inspection', formPath: '/form/canteen', icon: <MdRestaurant size={32} className="text-primary  hover:text-tertiary" /> },
  { title: 'Fuel Storage Tank Inspection Checklist', formPath: '/form/fuel', icon: <MdLocalGasStation size={32} className="text-primary hover:text-tertiary" /> },
  { title: 'Hand and Power Tool Inspection Form', formPath: '/form/hand-and-power', icon: <MdBuild size={32} className="text-primary hover:text-tertiary" /> },
  { title: 'PPE Inspection Form', formPath: '/form/ppe', icon: <MdHealthAndSafety size={32} className="text-primary hover:text-tertiary" /> },
  { title: 'Science Laboratory Inspection Form', formPath: '/form/science-laboratory', icon: <MdScience size={32} className="text-primary hover:text-tertiary" /> },
  { title: 'Swimming Pool Inspection Checklist', formPath: '/form/swimming-pool', icon: <MdPool size={32} className="text-primary hover:text-tertiary" /> },
  { title: 'Vehicle Inspection Form', formPath: '/form/vehicle', icon: <MdLocalShipping size={32} className="text-primary hover:text-tertiary" /> },
];*/}

const inspections = [
  { title: 'Canteen Inspection', formPath: '/form/canteen', image: '/canteen.png' },
  { title: 'Fuel Storage Tank Inspection Checklist', formPath: '/form/fuel', image: '/fuel.png' },
  { title: 'Hand and Power Tool Inspection Form', formPath: '/form/hand-and-power', image: '/tools.png' },
  { title: 'PPE Inspection Form', formPath: '/form/ppe', image: '/ppe.png' },
  { title: 'Science Laboratory Inspection Form', formPath: '/form/science-laboratory', image: '/lab.png' },
  { title: 'Swimming Pool Inspection Checklist', formPath: '/form/swimming-pool', image: '/pool.png' },
  { title: 'Vehicle Inspection Form', formPath: '/form/vehicle', image: '/vehicle.png' },
];












export default function InspectionDashboard() {
  const navigate = useNavigate();

  return (
    <div className="p-6" style={{ backgroundImage: "url('/image.png')" }}>
      <h1 className="text-3xl font-bold mb-6">Inspection Forms</h1>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-20">
        {inspections.map((item, idx) => (
          <div
            key={idx}
            onClick={() => navigate(item.formPath)}
            className="flex items-center gap-4 cursor-pointer shadow-gray-300 p-6 rounded-lg shadow-md hover:bg-primary hover:text-tertiary transition duration-200"
          >
                <img
      src={item.image}
      alt={item.title}
      className="w-10 h-10 object-contain"
    />
            <h2 className="text-lg font-semibold">{item.title}</h2>
          </div>
        ))}
      </div>
    </div>
  );
}
